@Birat Poudel इराकी बेबिलोनिया धर्मबाट निस्केका धर्महरु सबै अन्धबिश्वासी हुन जस्लाइ अब्राहम धर्म पनि भनिन्छ।अब्राहम,इब्राहिम,ब्राह्मण यिनीहरुको मतलब सर्बश्रेष्ठ हो तर हैन पाखण्ड को अर्को नाम हो यिनीहरु।
   इरानका प्राचीन ज्योतिष ज्येरास्थुर ले  निकालेको करिब 3 हजार 5 बर्ष पुरानो पारसी हो पारसी नैं थिए ब्राह्मणहरु पनि त्यो बेला तर ब्राह्मणहरु पारसी धर्ममा हिंसा मिसायको ले पारसीहरुले 3 हजार बर्ष पहिला लखेटेर आर्य वा ब्राह्मणहरुलाइ भारत अथवा आजको पाकिस्तान को सिन्धु मा पुर्‍याइ दियो।पारसी वा पर्सियन को मुख्य देवता आहुर माज्दा बाहेक अन्य देवता इन्द्र,बरुवाकाशा वा बरुण,मृत्युको देवता यामा राखेर कथित आज को सनातनी धर्म बनाए।मुगलकालमा बिकशित गरेको हिन्दु धर्ममा ती देबताहरु भन्दा मुगलकालमा प्रकट भएका ब्रम्हा,बिष्णु,महेश्वर को लिला नैं मुख्य बने।लगत्तै राम,कृष्ण आदि प्रकट भए तर "सनातन" देखि चलेको मान्छे हत्या गरेर यज्ञ गर्नें नरमेघ यज्ञ आज सम्मै जारी छ।मुगलले कानुन बनाएर बन्द गरे पनि बन्द भएन।अंग्रेजले सन् 1945 एक्ट द्वारा बन्द गरे पनि आज पनि जारी छ।हाल सालै नेपालमा नरमेघ यज्ञ गरेको समाचार आएको थियो।सति प्रथा,कन्या शिशु जन्मना साथै अहिले गर्भ मै हत्या,बर्णाश्रम ब्यबस्था,दलित भनेर पुर्खौली पेशा मा फसाइ राखेको कहिलै राष्ट्रपती,प्रधानमन्त्री बन्न नसकिने गरि मनुबादी संबिधान बनाय नेपालमा क्रिस्चियन र मुस्लिम त कुनै पनि हालतमा राष्ट्रपति,प्रधानमन्त्री बन्ने चान्सनैं छैन तर भारतमा राष्ट्रपति,प्रधानमन्त्री जो पनि बन्छ बनेका पनि छ।

  हिन्दुहरुले जत्ती पनि

@Birat Poudel अंग्रेजले भारत छोडेर गएको 70 बर्ष बन्दा बढी भैइ सक्यो कहाँ अंग्रेज को अनुसार पढाइन्छ?द्रबिड भारतको मुलनिवासी रे तर ब्राह्मण कसरी?ब्राह्मण त आर्य मात्रै हुन्छ्न।श्रीलंका का द्रबिड आतंककारी ब्राह्मण प्रभाकरणले LTTE आतंककारी संस्था खोलेर श्रीलंका का मुलनिवासी सिंहाली लाखौं बौद्ध को हत्या गरे।त्येस्तै तामिलनाडु का आतंककारी ब्राह्मण नेता  करुणाकरण ले पनि प्रभाकरण कै पक्ष लिए।द्रबिड को ईतिहास मनपरी बनाउने अंग्रेज हो।सिन्धु को 7 हजार बर्ष पुरानो सभ्यताहरु मेहेजोडाडो,कालिबंगा,चिहुनडाडो,हडप्पा,
खम्भात📢थियो।त्यो द्रबिड को हैन भारतका सुनीती कुमार चट्टर्जी अनुसार किरात पनि हैन।द्रबिडको भनेर अंग्रज ले हल्ला गरेको ब्राह्मणहरुलाइ खुशी पार्न।इरानबाट आएका ब्राह्मण झुण्ड मध्ये द.भारतमा पुगेका ग्रुप हुन त्येसैले द्रबिड आर्य नैं हुन किरात भनेको चट्टर्जी को ब्याक्तीगत धारणा हो।इरानियन ब्राह्मणहरु संग डरायर द्रबिडहरु तामिलनाडु मा कसरी पुगे।सिन्धु सभ्यताहरु 75% करिब आजको पाकिस्तान मा पर्छ।सिन्धु का सबै मान्छेहरुलाइ ब्राह्मणहरुले या त हत्या गरे या त गुलाम बनाय।ब्राह्मणहरु आफू अशिक्षित शिक्षितहरुलाइ डाह र ईष्र्या गर्थे त्येसैले इरानबाट शिक्षित पारसीहरुले लखेटे।ब्राह्मण गाँउले थिए पारसीहरु शहरी।सिन्धुबासी पनि शहरी थिए।ऋगबेद सिन्धु सभ्यताका राजाहरुलाइ मात्रै लखेटी लखेटी हत्या गरेको मात्रै बर्णन छ्न।सिचाइ को कुलो भत्कएको,सयौं पशु फुकाए को पनि बर्णन छ। जब भारतमा बुद्ध को समय आयो तब बुद्धकालिन बौद्ध बिश्वबिद्धालयहरु तक्षशिला,नालन्दा,बिक्रमशिला नष्ट गरे लाखौं बिज्ञान,गणित,इतिहास,भूगोल,खगोल,बास्तुकला,धर्म दर्शन आदि ग्रन्थहरु  पनि नष्ट गरे अशिक्षित ब्राह्मणहरुले।बिश्वभरीबाट PHD Doctor तथा Medical Doctor समेत उत्पादन हुन्थे।ब्राह्मणहरु इसाको नवम् शताब्दी सम्मै लेख्न पढन जाँदैन थिए यो कुरा अंग्रेज ले लुकाए तर ब्राह्मणहरुले नैं सत्य को पोल खोले तर ब्राह्मणहरुलाइ केही पागल अंग्रेजहरु ले ब्राह्मणहरुलाइ उचालेको उचालै गरे।म्यक्समुलरले लाखौं बर्ष पाहिले चन्द्रमामा मात्रै हैन एलिनहरु को ग्रहमा पनि गएको भनेर ब्राह्मणहरुलाइ उचाले।विल्सन ले मिश्र(इजिप्ट) नै ब्राह्मणहरुको नाममा राखेको,श्याम(थाइल्यान्ड) र बर्मा(म्यानमार) हिन्दु गड को नामामा राखेको,आयरल्यान्ड आर्य को नामबाट राखेको भनेर उचाले।इसाको पाँचौ शताब्दी मा बुद्धको भाषा पालीबाट उत्पत्ति गरेको संस्कृत भाषा र त्येस्को लिपि पनि इसा को नवम् शताब्दी मा पालीबाटै बिकशित गरेको देबनागरिक लिपि पनि बिश्वको सबै भाषाहरुको जननी रे।सोपनहवार ले बिश्वका बैज्ञानिकहरुले बेद पढेर आबिशकार गरे रे तर स्वयम् ब्राह्मणहरुले पढेर के के आबिश्कार गरे त?धेरै पछी एक जना अंग्रेज ले संस्कृत भाषा मात्रै कम्प्युटर मा राख्न मिल्छ अरु मिल्दैन रे त के आज सम्म अमेरिका,रुस,चीन आदिले कम्प्युटर मा संस्कृत भाषा राखेर काम गरि रहे त?
📢 खम्भात गुजरात भारतको त्यो पनि सिन्धु सभ्यता अन्तर्गत राखेको देखिन्छ तर खम्भात ब्राह्मणहरु ईरान मै हुंदा समुन्द्र मा डुबी सके।सन् 2001 मात्रै पत्ता लगाए।
